description:
My first attempt at putting together a torrent... hope this works.

&quot;The amazing and almost true life story of a rock n' roll legend.&quot; This 100-minute mockumentary includes Al's first 8 videos: &quot;Ricky,&quot; &quot;I Love Rocky Road,&quot; &quot;Eat It,&quot; &quot;I Lost On Jeopardy,&quot; &quot;This Is The Life,&quot; &quot;Like A Surgeon,&quot; &quot;Dare To Be Stupid&quot; and &quot;One More Minute.&quot;

Converted to DVD (ISO file) from an original VHS tape. 20+ years out of print and never released on DVD format - must have for any fan of &quot;Weird Al&quot; Yankovic.
